import * as React from 'react';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { useDispatch ,useSelector} from "react-redux";
import { useState } from "react";
import { postProduct } from "../../features/Product/ProductSlice";
import { useNavigate } from "react-router-dom";

import { useForm } from "react-hook-form";

const AddProduct = () => {
  const [product, setProduct] = useState({ name:" ",description:" ", price:" " ,telephone:" ",imgUrl:""});
  const arrU = useSelector(x => x.products.arrProducts);
  const currentproduct = useSelector(u => u.products.currentproduct);
  const dispatch = useDispatch();
  const nav=useNavigate()
const defaultTheme = createTheme();

  const {
      register,
      handleSubmit,
      getValues,
      formState: { errors, dirtyFields, isValid },
  } = useForm({ mode: 'onBlur' });

  const onSubmit = (data) => {

      dispatch(postProduct({name:data.name, description:data.description, price:data.price,imgUrl:data.imgUrl}))
       nav('/productLst')
      // כאן תוכל להוסיף את הלוגיקה שלך לטיפול בהגשת הטופס
      // לדוג', שליחת המידע לשרת או עדכון המצב באפליקציה
  };
return (<div>
  {/* <ThemeProvider theme={defaultTheme}>
      <Grid container component="main" sx={{ height: '50vh' , width:'60vw',marginLeft:'20vw'}}>
        <CssBaseline />
        <Grid
          item
          xs={false}
          sm={4}
          md={7}
        />
        <Grid item xs={12} sm={8} md={5} component={Paper} elevation={6} square> */}
          <Box
            sx={{
              my: 8,
              mx: 4,
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
            }}
          >
            <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
              <LockOutlinedIcon />
            </Avatar>
            <Typography component="h1" variant="h5">
              Add Product
            </Typography></Box>
            <form onSubmit={handleSubmit(onSubmit)}>
            {/* <Box component="form" noValidate  sx={{ mt: 1 }}> */}
             <div>
              <TextField
                margin="normal"
                required
                fullWidth
                id="name"
                label="name"
                name="name"
                autoComplete="name"
                autoFocus
                onChange={(e) =>  setProduct({ name:e.target.value, description: product.description, price:product.price,imgUrl:product.imgUrl})}
                {...register("name", { required: "field is required", pattern: /^[A-Za-z]+$/i })}
          
              />
                               {errors.name?.type === 'required' && <p>{errors.name.message}</p>}
                    {errors.name?.type === 'pattern' && <p>enter in english</p>}
                    {dirtyFields.name && <p>✔️</p>}
                </div>
                <br />
                <div>
              <TextField
                margin="normal"
                required
                fullWidth
                id="description"
                label="description"
                name="description"
                autoComplete="description"
                autoFocus
                onChange={(e) =>  setProduct({ name:product.name, description: e.target.value, price:product.price,imgUrl:product.imgUrl})}
                {...register("description", { required: "field is required", pattern: /^[A-Za-z]+$/i })}
          
              />                 {errors.name?.type === 'required' && <p>{errors.description.message}</p>}
              {errors.description?.type === 'pattern' && <p>enter in english</p>}
              {dirtyFields.description && <p>✔️</p>}
          </div>
          <br />
          <div>
              <TextField
                margin="normal"
                type='number'
                required
                fullWidth
                id="price"
                label="price"
                name="price"
                autoComplete="price"
                autoFocus
                onChange={(e) =>  setProduct({ name:product.name, description: product.description, price:e.target.value,imgUrl:product.imgUrl})}
                {...register("price",  { required: "field is required"})}
          
              />                                    {errors.price?.type === 'required' && <p>{errors.price.message}</p>}
              {dirtyFields.price && <p>✔️</p>}
          </div>
          <br />
          <div>
              <TextField
                margin="normal"
                required
                fullWidth
                id="imgUrl"
                label="imgUrl"
                name="imgUrl"
                autoComplete="imgUrl"
                autoFocus
                onChange={(e) =>  setProduct({ name:product.name, description: product.description, price:product.price,imgUrl:e.target.value})}
                {...register("imgUrl", { required: "field is required", pattern: /^[A-Za-z]+$/i })}
          
              />   
                               {errors.imgUrl?.type === 'required' && <p>{errors.imgUrl.message}</p>}
                    {errors.imgUrl?.type === 'pattern' && <p>enter in english</p>}
                    {dirtyFields.name && <p>✔️</p>}
                </div>
                <br />
                <div></div>
                             
                             <input type="submit" value={"Send"} />
            </form>
              {/* <Button
                type="submit"
                fullWidth
                variant="contained"
                sx={{ mt: 3, mb: 2 }}
              >
                Add
              </Button>
            </Box>    </form>

          </Box> */}
        {/* </Grid>
      </Grid>
    </ThemeProvider> */}
</div>
  );
}
export default AddProduct;
